let currentPositionZ = feature.position.z + 0.5;
let currentPositionX = feature.position.x + 0.5;

let positionZ = feature.position.z;
let positionX = feature.position.x;
let rotationY = 180;

let angle = 0;
let radius = 4;
let check = 1;

setInterval(() => {
    feature.position.z = positionZ + radius * Math.sin(angle);
    feature.position.x = positionX + radius * Math.cos(angle);

    if (feature.position.x >= (positionX + positionX / 2)) {
        feature.rotation.y = rotationY;
        rotationY += 30;
    }

    angle += 0.1;
}, 1000);

feature.on('trigger',e=>{
  let r1 = feature.createAnimation('position')
  let r2 = feature.createAnimation('position')

  r1.setKeys([{
    frame: 30, // standard is 30 fps (means it take 1 second)
    value: feature.position.add( new Vector3(0,0,-1.95) )
  }])

  r2.setKeys([{
      frame: 30, // standard is 50 fps (means it take 1 second)
      value: feature.position.add( new Vector3(0,0,0) )
  }])

  feature.startAnimations( [r1] )

  setTimeout(() => {
    feature.startAnimations( [r2] )
  }, 3000);
})

